hwt.bodyText:
If(st._eq(stT.idle),
    al_next((sda_chk & (~(sig_ & sig_) | (sig_ & sig_) | (sig_ & sig_)) & (~sda_t)) | ((~lastSda) & ((sig_ & sig_) | (sig_ & sig_) | (sig_ & sig_)) & ((sig_ & sig_) | (sig_ & sig_) | (sig_ & sig_)) & (~cmd_stop))),
).Else(
    al_next(sda_chk & (~(sig_ & sig_) | (sig_ & sig_) | (sig_ & sig_)) & (~sda_t)),
)

If(al,
    cntrl_rd(0x0),
    sda_t_next(0x0),
    scl_t_next(0x0),
    sda_chk_next(0x0),
).Else(
    If((st._eq(stT.start_1)) | (st._eq(stT.start_2)) | (st._eq(stT.start_3)) | (st._eq(stT.stop_1)) | (st._eq(stT.stop_2)) | (st._eq(stT.stop_3)) | (st._eq(stT.rd_1)) | (st._eq(stT.rd_2)) | (st._eq(stT.wr_1)) | (st._eq(stT.wr_2)),
        scl_t_next(0x0),
    ).Elif((st._eq(stT.start_4)) | (st._eq(stT.stop_0)) | (st._eq(stT.rd_0)) | (st._eq(stT.rd_3)) | (st._eq(stT.wr_0)) | (st._eq(stT.wr_3)),
        scl_t_next(0x1),
    ).Else(
        scl_t_next(scl_t),
    ),
    If((st._eq(stT.start_0)) | (st._eq(stT.start_1)) | (st._eq(stT.stop_3)) | (st._eq(stT.rd_0)) | (st._eq(stT.rd_1)) | (st._eq(stT.rd_2)) | (st._eq(stT.rd_3)),
        sda_t_next(0x0),
    ).Elif((st._eq(stT.start_2)) | (st._eq(stT.start_3)) | (st._eq(stT.start_4)) | (st._eq(stT.stop_0)) | (st._eq(stT.stop_1)) | (st._eq(stT.stop_2)),
        sda_t_next(0x1),
    ).Elif((st._eq(stT.wr_0)) | (st._eq(stT.wr_1)) | (st._eq(stT.wr_2)) | (st._eq(stT.wr_3)),
        sda_t_next(~cntrl_din),
    ).Else(
        sda_t_next(sda_t),
    ),
    cntrl_rd(((st._eq(stT.start_4)) | (st._eq(stT.stop_3)) | (st._eq(stT.rd_3)) | (st._eq(stT.wr_3)))._ternary(Bits(1).fromPy(0x1), Bits(1).fromPy(0x0))),
    sda_chk_next(sda_chk),
)

If((clkCntr._eq(0x0)) | ((lastScl & (~(sig_ & sig_) | (sig_ & sig_) | (sig_ & sig_)) & (~scl_t))._eq(0x1)),
    clkCntr_next((clk_cnt_initVal)._reinterpret_cast(Bits(16, signed=False, forceVector=True))),
    stateClkEn_next(0x1),
).Elif(slave_wait,
    stateClkEn_next(0x0),
    clkCntr_next(clkCntr),
).Else(
    clkCntr_next(clkCntr - 1),
    stateClkEn_next(0x0),
)

If(st._eq(stT.idle),
    If(al,
        st_next(stT.idle),
    ).Elif(cntrl_cmd._eq(0x0),
        st_next(stT.idle),
    ).Elif(cntrl_cmd._eq(0x1),
        st_next(stT.start_0),
    ).Elif(cntrl_cmd._eq(0x2),
        st_next(stT.stop_0),
    ).Elif(cntrl_cmd._eq(0x4),
        st_next(stT.wr_0),
    ).Elif(cntrl_cmd._eq(0x3),
        st_next(stT.rd_0),
    ).Else(
        st_next(st),
    ),
).Elif(st._eq(stT.start_0),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.start_1),
    ),
).Elif(st._eq(stT.start_1),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.start_2),
    ),
).Elif(st._eq(stT.start_2),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.start_3),
    ),
).Elif(st._eq(stT.start_3),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.start_4),
    ),
).Elif(st._eq(stT.start_4),
    st_next(stT.idle),
).Elif(st._eq(stT.stop_0),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.stop_1),
    ),
).Elif(st._eq(stT.stop_1),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.stop_2),
    ),
).Elif(st._eq(stT.stop_2),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.stop_3),
    ),
).Elif(st._eq(stT.stop_3),
    st_next(stT.idle),
).Elif(st._eq(stT.rd_0),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.rd_1),
    ),
).Elif(st._eq(stT.rd_1),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.rd_2),
    ),
).Elif(st._eq(stT.rd_2),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.rd_3),
    ),
).Elif(st._eq(stT.rd_3),
    st_next(stT.idle),
).Elif(st._eq(stT.wr_0),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.wr_1),
    ),
).Elif(st._eq(stT.wr_1),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.wr_2),
    ),
).Elif(st._eq(stT.wr_2),
    If(al,
        st_next(stT.idle),
    ).Else(
        st_next(stT.wr_3),
    ),
).Else(
    st_next(stT.idle),
)
